const seaAnemones = {
    src: 'https://commons.wikimedia.org/wiki/Category:Images#/media/File:Anemones_0429.jpg',
    alt: 'Sea Anemones',
    width:  '300px'
  };
  
  class SeaAnemones extends React.Component {
    render() {
      return (
        <div>
          <h1>Colorful Sea Anemones</h1>
          <img 
            src={SeaAnemones.src}
            alt={SeaAnemones.alt}
            width={SeaAnemones.width} />
        </div>
      );
    }
  }
  
  ReactDOM.render(
    <SeaAnemones/>,
    document.getElementById('app')
  );
